"original": |2-
     This REQUIRED Printer attribute indicates the amount of time (in
     seconds) that this Printer instance has been up and running.  The
     value is a monotonically increasing value starting from 1 when the
     Printer is started up (initialized, booted, etc.).  This value is
     used to populate the Event Time Job Status attributes
     "time-at-creation", "time-at-processing", and "time-at-completed"
     (see Section 5.3.14).
"fixed": |-
  This REQUIRED Printer attribute indicates the amount of time (in seconds) that this Printer instance has been up and running.  The value is a monotonically increasing value starting from 1 when the Printer is started up (initialized, booted, etc.).  This value is used to populate the Event Time Job Status attributes "time-at-creation", "time-at-processing", and "time-at-completed" (see Section 5.3.14).
"ko": |-
  이 필수 프린터 속성은 이 프린터 인스턴스가 작동되어 실행된 시간(초)을 나타냅니다. 값은 프린터가 시작(초기화, 부팅 등)될 때 1부터 시작하여 단조롭게 증가하는 값입니다. 이 값은 이벤트 시간 작업 상태 속성 "생성 시간", "처리 시간" 및 "완료 시간"을 채우는 데 사용됩니다(섹션 5.3.14 참조).
